package com.testwa.distest.server.entity;import com.testwa.core.base.bo.BaseEntity;import com.testwa.core.base.mybatis.annotation.Column;import lombok.Data;import java.util.Date;@Datapublic class ProjectBaseEntity extends BaseEntity {    @Column(name = "projectId")    private Long projectId;    @Column(name = "createTime")    private Date createTime;    @Column(name = "updateTime")    private Date updateTime;    @Column(name = "createBy")    private Long createBy;    @Column(name = "updateBy")    private Long updateBy;    public void setCreateTime(Date createTime) {        this.createTime = createTime;        this.updateTime = createTime;    }    public void setCreateBy(Long createBy) {        this.createBy = createBy;        this.updateBy = createBy;    }}